import React from 'react';

const Calendar = () => {
  return (
    <div>
      <h2>My Google Calendar</h2>
      <iframe
        src="https://calendar.google.com/calendar/embed?src=your_calendar_id&ctz=your_time_zone"
        style={{ border: 0 }}
        width="800"
        height="600"
        frameBorder="0"
        scrolling="no"
      ></iframe>
    </div>
  );
};

export default Calendar;
